class Solution {

    /**
     * Calculates the sum of digits of a given number represented as a string.
     *
     * @param String $num The number as a string.
     * @return Integer The sum of digits.
     */
    private function digitSum($num) {
        $sum = 0;
        for ($i = 0; $i < strlen($num); $i++) {
            $sum += $num[$i];
        }
        return $sum;
    }

    /**
     * Checks if the digit sum of a number within the given range matches the criteria.
     *
     * @param String $num1 Starting number as a string.
     * @param String $num2 Ending number as a string.
     * @param Integer $min_sum Minimum sum of digits.
     * @param Integer $max_sum Maximum sum of digits.
     * @return Integer The count of numbers meeting the criteria.
     */
    function count($num1, $num2, $min_sum, $max_sum) {
        $MOD = 1000000007;

        $count = 0;
        $start = max(1, intval($num1));
        $end = intval($num2);

        // Precompute digit sums for possible sums to optimize the loop
        $digitSums = [];
        for ($i = 0; $i <= 400; $i++) {
            $digitSums[$i] = $this->digitSum((string)$i);
        }

        for ($i = $start; $i <= $end; $i++) {
            $sum = 0;
            $temp = $i;
            while ($temp > 0) {
                $sum += $temp % 10;
                $temp = intdiv($temp, 10);
            }

            if ($sum >= $min_sum && $sum <= $max_sum) {
                $count = ($count + 1) % $MOD;
            }
        }

        return $count;
    }
}
